import React from "react";
import Link from "next/link";

export default function about() {
  return (
    <div className="container">
        <style jsx>
          {`
            ul {
              list-style-type: none;
              margin-right: 2rem;
            }

            a {
              float: right;
              color: blue;
              text-align: center;
              padding: 10px;
              text-decoration: none;
              font-size: 20px;
              line-height: 35px;
              border-radius: 4px;
              display: block;
              font-family: "Roboto", sans-;
            }

            header {
              overflow: hidden;
              background-color: lightblue;
              position: fixed;
              top: 0;
              width: 100%;
              float: right;
              padding: 5px;
            }
          `}
        </style>
        <style jsx global>{`

  body {
    background: lightblue};
  }

`}</style>
      <header>
        <nav>
          <ul>
            <Link href="/contact">
              <a>Contact</a>
            </Link>
            <Link href="/projects">
              <a>Projects</a>
            </Link>
            <Link href="/about">
              <a>About Me</a>
            </Link>
            <Link href="/">
              <a>Home</a>
            </Link>
          </ul>
        </nav>
      </header>
      <div className="flex-container">
        <div className="flex-item-left">
          <h1>Looking for a developer ?</h1>
          <p>
            Welcome to my Porfolio website. my name is OLALEKAN OGUNDELE I am a
            Small Business Owner,Photograher and aspiring Full Stack Web
            Developer. You can see some of the things i have worked on on my and
            also on my Github page
          </p>
        </div>
        <div class="flex-item-right">
          <h3>Skills and Tools</h3>

          <ul id="skilllist">
            <li>HTML</li>
            <li>CSS</li>
            <li>JAVASCRIPT</li>
            <li>Bootstrap</li>
            <li>Git</li>
            <li>Nodejs</li>
          </ul>
        </div>
      </div>
    </div>
  );
}
